INSERT INTO `lw_forum_post` (`post_id`, `deleted`, `topic_id`, `user_id`, `text`, `category`, `created_at`, `updated_at`, `edit_count`, `edit_user_id`)
VALUES (1, 0, 1, 4, '<p>Maecenas tristique, est et tempus semper, est quam pharetra magna, ac consequat metus sapien ut nunc. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Mauris viverra diam vitae quam. Suspendisse potenti. Nullam porttitor lacus at turpis. Donec posuere metus vitae ipsum.</p>', NULL, '2021-02-19 18:33:49', '2021-02-19 18:33:49', 0, NULL),
       (2, 0, 2, 4, '<p>Vestibulum rutrum rutrum neque.</p>', NULL, '2021-02-19 18:34:02', '2021-02-19 18:34:02', 0, NULL),
       (3, 0, 2, 1, '<p>Donec ut dolor. Morbi vel lectus in quam fringilla rhoncus. Mauris enim leo, rhoncus sed, vestibulum sit amet, cursus id, turpis. Integer aliquet, massa id lobortis convallis, tortor risus dapibus augue, vel accumsan tellus nisi eu orci. Mauris lacinia sapien quis libero.</p>', NULL, '2021-02-19 18:34:32', '2021-02-19 18:34:32', 0, NULL),
       (4, 0, 2, 1, '<p>Sed sagittis. Nam congue, risus semper porta volutpat, quam pede lobortis ligula, sit amet eleifend pede libero quis orci. Nullam molestie nibh in lectus.</p>', NULL, '2021-02-19 18:34:38', '2021-02-19 18:34:38', 0, NULL),
       (5, 0, 2, 1, '<p>Proin leo odio, porttitor id, consequat in, consequat ut, nulla.</p>', NULL, '2021-02-19 18:34:43', '2021-02-19 18:34:43', 0, NULL),
       (6, 0, 1, 1, '<p>Sed sagittis. Nam congue, risus semper porta volutpat, quam pede lobortis ligula, sit amet eleifend pede libero quis orci. Nullam molestie nibh in lectus. Pellentesque at nulla.</p>', NULL, '2021-02-19 18:34:51', '2021-02-19 18:34:51', 0, NULL),
       (7, 0, 1, 1, '<p>Maecenas tincidunt lacus at velit. Vivamus vel nulla eget eros elementum pellentesque. Quisque porta volutpat erat. Quisque erat eros, viverra eget, congue eget, semper rutrum, nulla. Nunc purus.</p>', NULL, '2021-02-19 18:34:57', '2021-02-19 18:34:57', 0, NULL),
       (8, 0, 3, 1, '<p>Vivamus metus arcu, adipiscing molestie, hendrerit at, vulputate vitae, nisl.</p>', NULL, '2021-02-19 18:35:12', '2021-02-19 18:35:12', 0, NULL),
       (9, 0, 4, 1, '<p>Curabitur convallis. Duis consequat dui nec nisi volutpat eleifend. Donec ut dolor. Morbi vel lectus in quam fringilla rhoncus. Mauris enim leo, rhoncus sed, vestibulum sit amet, cursus id, turpis.</p>', NULL, '2021-02-19 18:35:26', '2021-02-19 18:35:26', 0, NULL),
       (10, 0, 4, 1, '<p>In blandit ultrices enim. Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Proin interdum mauris non ligula pellentesque ultrices.</p>', NULL, '2021-02-19 18:35:32', '2021-02-19 18:35:32', 0, NULL),
       (11, 0, 4, 1, '<p>Donec vitae nisi. Nam ultrices, libero non mattis pulvinar, nulla pede ullamcorper augue, a suscipit nulla elit ac nulla. Sed vel enim sit amet nunc viverra dapibus. Nulla suscipit ligula in lacus. Curabitur at ipsum ac tellus semper interdum.</p>', NULL, '2021-02-19 18:35:38', '2021-02-19 18:35:38', 0, NULL),
       (12, 0, 4, 1, '<blockquote><strong>admin:</strong></blockquote><blockquote>In blandit ultrices enim. Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Proin interdum mauris non ligula pellentesque ultrices.</blockquote><p><br /></p><p>Nulla ut erat id mauris vulputate elementum. Nullam varius.</p>', NULL, '2021-02-19 18:35:57', '2021-02-19 18:35:57', 0, NULL),
       (13, 0, 5, 2, '<p>Nulla suscipit ligula in lacus. Curabitur at ipsum ac tellus semper interdum. Mauris ullamcorper purus sit amet nulla.</p>', NULL, '2021-02-19 18:36:30', '2021-02-19 18:36:30', 0, NULL),
       (14, 0, 5, 2, '<p>Duis bibendum, felis sed interdum venenatis, turpis enim blandit mi, in porttitor pede justo eu massa. Donec dapibus. Duis at velit eu est congue elementum. In hac habitasse platea dictumst. Morbi vestibulum, velit id pretium iaculis, diam erat fermentum justo, nec condimentum neque sapien placerat ante.</p>', NULL, '2021-02-19 18:36:50', '2021-02-19 18:36:50', 0, NULL),
       (15, 0, 5, 2, '<p>In blandit ultrices enim. Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Proin interdum mauris non ligula pellentesque ultrices.</p>', NULL, '2021-02-19 18:36:56', '2021-02-19 18:36:56', 0, NULL);

